export default function Battle() {
    const canvas = document.querySelector('canvas');
    const context = canvas.getContext('2d');
    canvas.width = 1024;
    canvas.height = 576;

    context.fillRect(0, 0, 1024, 576);

    
    return (
    <>
    <canvas></canvas>
    </>
    )
}
